pragma solidity 0.4.18;
import "./Restrictor.sol";
import "../lib/odll/userManager.sol";

contract ScanAppointmentWriter is Restrictor {

  function ScanAppointmentWriter(address _dbAddress) public {
    require(_dbAddress != 0x0);
    dbAddress = _dbAddress;
  }

  function writeScanAppointment (
    address dentistId,
    uint scanAppointmentId,
    bytes32 appointmentDate,
    bytes32 scanTime,
    bytes32 scanInsurance,
    bytes32 scanComment
  )
    external
    onlyPermittedSmartContract
  {
    userManager.writeScanAppointment(dbAddress, dentistId, msg.sender, scanAppointmentId, appointmentDate, scanTime, scanInsurance, scanComment);
  }

  function cancelScanAppointment (
    address dentistId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber
  )
    external
    onlyPermittedSmartContract
  {
    userManager.cancelScanAppointment(dbAddress, dentistId, msg.sender, scanAppointmentId, patientScanAppointmentIndexNumber);
  }

  function expireScanAppointment (
    address dentistId,
    address patientId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber
  )
    external
    onlyPermittedSmartContract
  {
    userManager.expireScanAppointment(dbAddress, dentistId, patientId, scanAppointmentId, patientScanAppointmentIndexNumber);
  }

  function acceptScanAppointment (
    address patientId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber,
    uint quote,
    bytes32 comment
  )
    external
    onlyPermittedSmartContract
  {
    userManager.acceptScanAppointment(dbAddress, msg.sender, patientId, scanAppointmentId, patientScanAppointmentIndexNumber, quote, comment);
  }

  function rejectScanAppointment (
    address patientId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber
  )
    external
    onlyPermittedSmartContract
  {
    userManager.rejectScanAppointment(dbAddress, msg.sender, patientId, scanAppointmentId, patientScanAppointmentIndexNumber);
  }
}
